import { Fragment } from "react";


const MessageList= (props) => {
    return (
        <div>{props.user}
        {props.messageList.map((message, i,) => (
            <div class="comment" key={i}><p>{message}</p></div>
        ))}
        </div>
    );
};

export default MessageList;
